// import React from 'react'

const edamam_app_id = process.env.REACT_APP_ID
const edamam_api_key = process.env.REACT_APP_API_KEY


// const testURL = 'https://api.edamam.com/search?app_id=900da95e&app_key=40698503668e0bb3897581f4766d77f9&q=coffee'

const getRecipesHandler = async (url, searchParams) => {
  console.log(edamam_api_key)
  console.log(edamam_app_id)
  const response = await fetch(
    url + "&" + new URLSearchParams(searchParams).toString()
  );
  return response.json();
};

export default getRequestHandler;
